import { Routes, Route, Link } from "react-router-dom";

function Header() {
    return (
       <header className="header">
            <div className="header__logo"></div>
            <div className="header__navigation">
                <Routes>
                    <Route path="/" element={
                        <>
                            <p>email</p>
                            <Link to='/sign-in'>Sign out</Link>
                        </>
                    }/>

                </Routes>
            </div>
        </header>
    )
    }
export default Header;
